yName>    <codeName>standardD4t30Efv</codeName>    <canReplace>ANTIRETROVIRAL DRUGS</canReplace>  </regimenSuggestion>  <regimenSuggestion>    <drugComponents>      <drugSuggestion>        <drugId>6</drugId>        <dose>40</dose>        <units>mg</units>        <frequency>2/day x 7 days/week</frequency>        <instructions></instructions>      </drugSuggestion>      <drugSuggestion reference=\"../../../regimenSuggestion[5]/drugComponents/drugSuggestion[2]\"/>      <drugSuggestion reference=\"../../../regimenSuggestion[4]/drugComponents/drugSuggestion[2]\"/>    </drugComponents>    <displayName>d4T(40) + 3TC + EFV(600)</displayName>    <codeName>standardD4t40Efv</codeName>    <canReplace>ANTIRETROVIRAL DRUGS</canReplace>  </regimenSuggestion></list>','XML description of standard drug regimens, to be shown as shortcuts on the dashboard regimen entry tab','0b5d53ca-55c6-41cb-b959-e7d005689bba',NULL,NULL,NULL,NULL),('dashboard.relationships.show_types',NULL,'Types of relationships separated by commas.  Doctor/Patient,Parent/Child','13e2732f-ed0d-40b4-9dd9-0ec1fc7215ed',NULL,NULL,NULL,NULL),('dashboard.showPatientName','false','Whether or not to display the patient name in the patient dashboard title. Note that enabling this could be security risk if multiple users operate on the same computer.','db975b7a-774e-4dbe-9f50-22c960a64c22','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('datePicker.weekStart','0','First day of the week in the date picker. Domingo/Dimanche/Sunday:0  Lunes/Lundi/Monday:1','67162164-daf4-4379-a79e-415feea4e835',NULL,NULL,NULL,NULL),('default_locale','en','Specifies the default locale. You can specify both the language code(ISO-639) and the country code(ISO-3166), e.g. \'en_GB\' or just country: e.g. \'en\'','037f68ad-1a16-4c69-b24c-673b9e4223e0',NULL,NULL,NULL,NULL),('default_location','Unknown Location','The name of the location to use as a system default','4cb76d25-f864-41db-831a-8523fae90405',NULL,NULL,NULL,NULL),('default_theme',NULL,'Default theme for users.  OpenMRS ships with themes of \'green\', \'orange\', \'purple\', and \'legacy\'','7597ff2c-1638-4662-9062-0bbdbfc2087a',NULL,NULL,NULL,NULL),('dhis.mandatory','false','true/false whether or not the dhis module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','ff33134e-854c-439d-b6fd-f2915018ed60',NULL,NULL,NULL,NULL),('dhis.started','true','DO NOT MODIFY. true/false whether or not the dhis module has been started.  This is used to make sure modules that were running  prior to a restart are started again','92d8bd46-b2e5-4d85-b687-b25a32d247ed',NULL,NULL,NULL,NULL),('drugOrder.drugOther','7c62f5c9-911a-11e5-b218-0050568236ae','Specifies the uuid of the concept which represents drug other non coded','2c93a7bb-19b7-4a23-a16e-527cc2fa1101',NULL,NULL,NULL,NULL),('drugOrder.requireDrug','false','Set to value true if you need to specify a formulation(Drug) when creating a drug order.','681e2f76-9392-46e5-ab13-1c8f2e5d0d39',NULL,NULL,NULL,NULL),('elisatomfeedclient.mandatory','false','true/false whether or not the elisatomfeedclient module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','e2ec9eec-6031-46aa-9aa9-6160b44812d0',NULL,NULL,NULL,NULL),('elisatomfeedclient.started','true','DO NOT MODIFY. true/false whether or not the elisatomfeedclient module has been started.  This is used to make sure modules that were running  prior to a restart are started again','11e0cd46-5015-4e57-90e4-7631f956ef4c',NULL,NULL,NULL,NULL),('emr.admissionEncounterType','8a362f72-3a91-11e5-b380-0050568236ae','UUID of the encounter type for admitting a patient','c4b94bb1-97a8-4252-bec3-c8b17d72b4b5',NULL,NULL,NULL,NULL),('emr.admissionForm',NULL,'UUID of the Admission Form (not required)','7d891161-0871-4f91-8754-4a114ffb1a63',NULL,NULL,NULL,NULL),('emr.atFacilityVisitType',NULL,'UUID of the VisitType that we use for newly-created visits','d6e5ada4-39a7-49e3-95fc-6ba2627eecae',NULL,NULL,NULL,NULL),('emr.concept.diagnosisSetOfSets','0a45f075-afb5-4353-a657-de053e8f8638',NULL,'3601973d-a23f-499d-929e-266ecd7c5cc5',NULL,NULL,NULL,NULL),('emr.encounterMatcher','org.bahmni.module.bahmnicore.matcher.EncounterSessionMatcher','custom encounter session matcher','8a51a0b7-3a91-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emr.exitFromInpatientEncounterType','8a391fe7-3a91-11e5-b380-0050568236ae','UUID of the encounter type for exiting a patient from inpatient care','fdb6b9ea-db33-44cb-b946-cc9e02baf50f',NULL,NULL,NULL,NULL),('emr.exitFromInpatientForm',NULL,'UUID of the Discharge Form (not required)','8416b9e9-054b-431f-8d36-09e7d6d511f2',NULL,NULL,NULL,NULL),('emr.extraPatientIdentifierTypes',NULL,'A list of UUIDs indicating extra Patient Identifier Types that should be displayed','24221bdf-3a37-4f7e-90f1-93cf50578b6d',NULL,NULL,NULL,NULL),('emr.personImagesDirectory','/home/bahmni/patient_images','Location of patient images - required by emrapi','3709fd5f-3f5a-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emr.primaryIdentifierType','8967f9d3-3a91-11e5-b380-0050568236ae','Primary identifier type for looking up patients, generating barcodes, etc','6ae8a24e-3a91-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emr.transferWithinHospitalEncounterType',NULL,'UUID of the encounter type for transferring a patient within the hospital','51f3a72c-57ec-492f-aeed-78266468fe51',NULL,NULL,NULL,NULL),('emr.transferWithinHospitalForm',NULL,'UUID of the Transfer Form (not required)','cffa69f2-7f06-43fa-93e5-94397aa7512b',NULL,NULL,NULL,NULL),('emr.unknownLocation',NULL,'UUID of the Location that represents an Unknown Location','33c1a05c-7ac2-4af5-bbc9-d5cd2e404541',NULL,NULL,NULL,NULL),('emr.unknownProvider','f9badd80-ab76-11e2-9e96-0800200c9a66','UUID of the Provider that represents an Unknown Provider','e041517d-340e-4d0d-aa17-dcb355f72038',NULL,NULL,NULL,NULL),('emr.visitNoteEncounterType',NULL,'UUID of the encounter type for a visit note','0c3ca640-d945-4854-adf0-465d3b159af4',NULL,NULL,NULL,NULL),('emrapi.lastViewedPatientSizeLimit','50','Specifies the system wide number of patients to store as last viewed for a single user,\r\n            defaults to 50 if not specified','0ff317a8-9f85-4a7d-8764-95ac1f702bc4',NULL,NULL,NULL,NULL),('emrapi.mandatory','false','true/false whether or not the emrapi module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','febbf7fd-0067-4ef9-a2c3-cd2d07e2dc2d',NULL,NULL,NULL,NULL),('emrapi.nonDiagnosisConceptSets',NULL,'UUIDs or mapping of non diagnosis concept sets','5ea361b3-8f0b-4f64-89d4-4c23fe5f4be7',NULL,NULL,NULL,NULL),('emrapi.sqlGet.wardsListDetails','SELECT\r\n  b.bed_number                                                                  AS \'Bed\',\r\n  concat(pn.given_name,\' \',pn.family_name)                                      AS \'Name\',\r\n  pv.uuid                                                                       AS \'Patient Uuid\',\r\n  pi.identifier                                                                 AS \'Id\',\r\n  pv.gender                                                                     AS \'Gender\',\r\n  TIMESTAMPDIFF(YEAR, pv.birthdate, CURDATE())                                  AS \'Age\',\r\n  pa.county_district                                                            AS \'District\',\r\n  pa.city_village                                                               AS \'Village\',\r\n  admission_provider_name.given_name                                            AS \'Admission By\',\r\n  cast(DATE_FORMAT(ev.encounter_datetime, \'%d %b %y %h:%i %p\') AS CHAR)         AS \'Admission Time\',\r\n  diagnosis.diagnosisConcept                                                    AS \'Diagnosis\',\r\n  diagnosis.certainty                                                          AS \'Diagnosis Certainty\',\r\n  diagnosis.diagnosisOrder                                                      AS \'Diagnosis Order\',\r\n  diagnosis.status                                                              AS \'Diagnosis Status\',\r\n  diagnosis.diagnosis_provider                                                  AS \'Diagnosis Provider\',\r\n  cast(DATE_FORMAT(diagnosis.diagnosis_datetime, \'%d %b %y %h:%i %p\') AS CHAR)  AS \'Diagnosis Datetime\',\r\n  dispositionInfo.providerName                                                  AS \'Disposition By\',\r\n  cast(DATE_FORMAT(dispositionInfo.providerDate, \'%d %b %y %h:%i %p\') AS CHAR)  AS \'Disposition Time\',\r\n  adtNotes.value_text                                                           AS \'ADT Notes\',\r\n  v.uuid                                                                        AS \'Visit Uuid\'\r\nFROM bed_location_map blm\r\n    INNER JOIN bed b ON blm.bed_id = b.bed_id\r\n    INNER JOIN bed_patient_assignment_map bpam ON b.bed_id = bpam.bed_id AND date_stopped IS NULL\r\n    INNER JOIN person pv ON pv.person_id = bpam.patient_id\r\n    INNER JOIN person_name pn on pn.person_id = pv.person_id\r\n    INNER JOIN patient_identifier pi ON pv.person_id = pi.patient_id\r\n    INNER JOIN person_address pa ON pa.person_id = pv.person_id\r\n    INNER JOIN (SELECT patient_id, max(encounter_datetime) AS max_encounter_datetime FROM encounter_view WHERE encounter_type_name = \'Admission\' GROUP BY patient_id) latestAdmissionEncounter ON pv.person_id = latestAdmissionEncounter.patient_id\r\n    INNER JOIN encounter_view ev on ev.patient_id = latestAdmissionEncounter.patient_id and ev.encounter_datetime = latestAdmissionEncounter.max_encounter_datetime\r\n    INNER JOIN visit v on ev.visit_id = v.visit_id\r\n    LEFT OUTER JOIN obs adtNotes on adtNotes.encounter_id = ev.encounter_id and adtNotes.voided = 0 and adtNotes.concept_id = (SELECT concept_id from concept_name where name = \'Adt Notes\' and concept_name_type = \'FULLY_SPECIFIED\')\r\n    LEFT OUTER JOIN encounter_provider ep ON ep.encounter_id = ev.encounter_id\r\n    LEFT OUTER JOIN provider admission_provider ON admission_provider.provider_id = ep.provider_id\r\n    LEFT OUTER JOIN person_name admission_provider_name ON admission_provider_name.person_id = admission_provider.person_id\r\n    LEFT OUTER JOIN (\r\n        SELECT\r\n            bpam.patient_id as person_id,\r\n            concept_name.name as disposition,\r\n            latestDisposition.obs_datetime as providerDate,\r\n            person_name.given_name as providerName\r\n        FROM bed_patient_assignment_map bpam\r\n            INNER JOIN (SELECT person_id, max(obs_id) obs_id from obs where concept_id = (SELECT concept_id from concept_name where name = \'Disposition\' and concept_name_type = \'FULLY_SPECIFIED\') GROUP BY person_id) maxObsId on  maxObsId.person_id = bpam.patient_id\r\n            INNER JOIN obs latestDisposition on maxObsId.obs_id = latestDisposition.obs_id and latestDisposition.voided = 0\r\n            INNER JOIN concept_name on latestDisposition.value_coded = concept_name.concept_id and concept_name_type = \'FULLY_SPECIFIED\'\r\n            LEFT OUTER JOIN encounter_provider ep ON latestDisposition.encounter_id = ep.encounter_id\r\n            LEFT OUTER JOIN provider disp_provider ON disp_provider.provider_id = ep.provider_id\r\n            LEFT OUTER JOIN person_name ON person_name.person_id = disp_provider.person_id\r\n        where bpam.date_stopped is null\r\n    ) dispositionInfo on pv.person_id = dispositionInfo.person_id\r\n    LEFT OUTER JOIN (\r\n        select\r\n            diagnosis.person_id as person_id,\r\n            diagnosis.obs_id as obs_id,\r\n            diagnosis.obs_datetime as diagnosis_datetime,\r\n            if(diagnosisConceptName.name is not null, diagnosisConceptName.name, diagnosis.value_text) as diagnosisConcept,\r\n            certaintyConceptName.name as certainty,\r\n            diagnosisOrderConceptName.name as diagnosisOrder,\r\n            diagnosisStatusConceptName.name as status,\r\n            person_name.given_name as diagnosis_provider\r\n        from bed_patient_assignment_map bpam\r\n            INNER JOIN (SELECT patient_id, MAX(date_started) date_started FROM visit GROUP BY patient_id) visitStartDate on visitStartDate.patient_id = bpam.patient_id\r\n            INNER JOIN visit latestVisit on latestVisit.patient_id = bpam.patient_id and latestVisit.date_started = visitStartDate.date_started\r\n            INNER JOIN encounter on encounter.visit_id = latestVisit.visit_id\r\n            INNER JOIN obs diagnosis on bpam.patient_id = diagnosis.person_id and diagnosis.voided = 0 and diagnosis.encounter_id = encounter.encounter_id\r\n                LEFT OUTER JOIN concept_name diagnosisConceptName on diagnosis.value_coded is not null and diagnosis.value_coded = diagnosisConceptName.concept_id and diagnosisConceptName.concept_name_type=\'FULLY_SPECIFIED\'\r\n                LEFT OUTER JOIN encounter_provider ep ON diagnosis.encounter_id = ep.encounter_id\r\n                LEFT OUTER JOIN provider diagnosis_provider ON diagnosis_provider.provider_id = ep.provider_id\r\n                LEFT OUTER JOIN person_name ON person_name.person_id = diagnosis_provider.person_id\r\n            INNER JOIN obs certainty on diagnosis.obs_group_id = certainty.obs_group_id and certainty.voided = 0 and certainty.concept_id = (select concept_id from concept_name where name = \'Diagnosis Certainty\' and concept_name_type=\'FULLY_SPECIFIED\')\r\n                LEFT OUTER JOIN concept_name certaintyConceptName on certainty.value_coded is not null and certainty.value_coded = certaintyConceptName.concept_id and certaintyConceptName.concept_name_type=\'FULLY_SPECIFIED\'\r\n            INNER JOIN obs diagnosisOrder on diagnosis.obs_group_id = diagnosisOrder.obs_group_id and diagnosisOrder.voided = 0 and diagnosisOrder.concept_id = (select concept_id from concept_name where name = \'Diagnosis order\' and concept_name_type=\'FULLY_SPECIFIED\')\r\n                LEFT OUTER JOIN concept_name diagnosisOrderConceptName on diagnosisOrder.value_coded is not null and diagnosisOrder.value_coded = diagnosisOrderConceptName.concept_id and diagnosisOrderConceptName.concept_name_type=\'FULLY_SPECIFIED\'\r\n            LEFT JOIN obs diagnosisStatus on diagnosis.obs_group_id = diagnosisStatus.obs_group_id and diagnosisStatus.voided = 0 and diagnosisStatus.concept_id = (select concept_id from concept_name where name = \'Bahmni Diagnosis Status\' and concept_name_type=\'FULLY_SPECIFIED\')\r\n                LEFT OUTER JOIN concept_name diagnosisStatusConceptName on diagnosisStatus.value_coded is not null and diagnosisStatus.value_coded = diagnosisStatusConceptName.concept_id and diagnosisStatusConceptName.concept_name_type=\'FULLY_SPECIFIED\'\r\n        where bpam.date_stopped is null and diagnosis.concept_id in (select concept_id from concept_name where name in (\'Coded Diagnosis\', \'Non-Coded Diagnosis\') and concept_name_type=\'FULLY_SPECIFIED\')\r\n    ) diagnosis ON diagnosis.person_id = pv.person_id\r\nWHERE b.status = \'OCCUPIED\' AND ev.encounter_type_name = \'ADMISSION\' AND blm.location_id in (SELECT child_location.location_id FROM location child_location join location parent_location on parent_location.location_id = child_location.parent_location WHERE parent_location.name =${location_name})','Sql query to get list of wards','991b7dbc-9727-11e5-b218-0050568236ae',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.activePatients','select distinct\r\n          concat(pn.given_name,\' \', pn.family_name) as name,\r\n          pi.identifier as identifier,\r\n          concat(\"\",p.uuid) as uuid,\r\n          concat(\"\",v.uuid) as activeVisitUuid,\r\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\r\n        from visit v\r\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\r\n        join patient_identifier pi on v.patient_id = pi.patient_id\r\n        join person p on p.person_id = v.patient_id\r\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.attribute_type_id = (\r\n          select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\"\r\n        ) and va.voided = 0\r\n        where v.date_stopped is null AND v.voided = 0','Sql query to get list of active patients','196f66de-3a92-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.activePatientsByProvider','select distinct concat(pn.given_name,\" \", pn.family_name) as name,\r\n  pi.identifier as identifier,\r\n  concat(\"\",p.uuid) as uuid,\r\n  concat(\"\",v.uuid) as activeVisitUuid,\r\n  IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\r\n  from\r\n    visit v join person_name pn on v.patient_id = pn.person_id and pn.voided = 0 and v.voided=0\r\n    join patient_identifier pi on v.patient_id = pi.patient_id and pi.voided=0\r\n    join person p on p.person_id = v.patient_id  and p.voided=0\r\n    join encounter en on en.visit_id = v.visit_id and en.voided=0\r\n    join encounter_provider ep on ep.encounter_id = en.encounter_id  and ep.voided=0\r\n    join provider pr on ep.provider_id=pr.provider_id and pr.retired=0\r\n    join person per on pr.person_id=per.person_id and per.voided=0\r\n    left outer join visit_attribute va on va.visit_id = v.visit_id and va.voided = 0 and va.attribute_type_id = (\r\n				select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\"\r\n			)\r\n  where\r\n    v.date_stopped is null and\r\n    pr.uuid=${provider_uuid}\r\n    order by en.encounter_datetime desc','Sql query to get list of active patients by provider uuid','1972c69e-3a92-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.additionalSearchHandler','cn.name = \'${testName}\'','Sql query to get list of admitted patients','16d5107a-3a92-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.admittedPatients','select distinct\r\n          concat(pn.given_name,\" \", pn.family_name) as name,\r\n          pi.identifier as identifier,\r\n          concat(\"\",p.uuid) as uuid,\r\n          concat(\"\",v.uuid) as activeVisitUuid,\r\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\r\n        from visit v\r\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\r\n        join patient_identifier pi on v.patient_id = pi.patient_id\r\n        join person p on v.patient_id = p.person_id\r\n        join visit_attribute va on v.visit_id = va.visit_id and va.value_reference = \"Admitted\" and va.voided = 0\r\n        join visit_attribute_type vat on vat.visit_attribute_type_id = va.attribute_type_id and vat.name = \"Admission Status\"\r\n        where v.date_stopped is null AND v.voided = 0','Sql query to get list of admitted patients','19728330-3a92-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.allPatients','select ppa.value_reference as identifier,concat(pn.given_name,\' \', pn.family_name) as name,prog.name as Treatment, p.gender as gender,floor(datediff(now(), p.birthdate)/365) as age,concat(\"\",p.uuid) as uuid, pi.identifier as \"EMR ID\"\r\nfrom patient_program pp\r\n  inner join program prog on pp.program_id = prog.program_id\r\n  inner join patient_program_attribute ppa on pp.patient_program_id = ppa.patient_program_id\r\n  inner join program_attribute_type pat on ppa.attribute_type_id = pat.program_attribute_type_id\r\n  inner join person_name pn on pp.patient_id = pn.person_id\r\n  inner join person p on p.person_id = pn.person_id\r\n  inner join patient_identifier pi on pn.person_id = pi.patient_id\r\nwhere pat.name = \'Registration Number\' and p.voided = 0 and pn.voided = 0 and prog.retired=0',NULL,'3f70bd36-0459-49b1-a978-166a98f83ee9',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.highRiskPatients','SELECT DISTINCT\r\n  concat(pn.given_name, \" \", pn.family_name)           AS name,\r\n  pi.identifier                                        AS identifier,\r\n  concat(\"\", p.uuid)                                   AS uuid,\r\n  concat(\"\", v.uuid)                                   AS activeVisitUuid,\r\n  IF(va.value_reference = \"Admitted\", \"true\", \"false\") AS hasBeenAdmitted\r\nFROM person p\r\n  INNER JOIN person_name pn ON pn.person_id = p.person_id\r\n  INNER JOIN patient_identifier pi ON pn.person_id = pi.patient_id\r\n  INNER JOIN visit v ON v.patient_id = p.person_id AND v.date_stopped IS NULL AND v.voided = 0\r\n  INNER JOIN (SELECT\r\n                max(test_obs.obs_group_id) AS max_id,\r\n                test_obs.concept_id,\r\n                test_obs.person_id\r\n              FROM obs test_obs\r\n                INNER JOIN concept c ON c.concept_id = test_obs.concept_id AND test_obs.voided = 0\r\n                INNER JOIN concept_name cn\r\n                  ON c.concept_id = cn.concept_id AND cn.concept_name_type = \"FULLY_SPECIFIED\" AND\r\n                     cn.name IN (${testName})\r\n              GROUP BY test_obs.person_id, test_obs.concept_id) AS tests ON tests.person_id = v.patient_id\r\n  INNER JOIN obs abnormal_obs\r\n    ON abnormal_obs.obs_group_id = tests.max_id AND abnormal_obs.value_coded = 1 AND abnormal_obs.voided = 0\r\n  INNER JOIN concept abnormal_concept ON abnormal_concept.concept_id = abnormal_obs.concept_id\r\n  INNER JOIN concept_name abnormal_concept_name\r\n    ON abnormal_concept.concept_id = abnormal_concept_name.concept_id AND\r\n       abnormal_concept_name.concept_name_type = \"FULLY_SPECIFIED\" AND\r\n       abnormal_concept_name.name IN (\"LAB_ABNORMAL\")\r\n  LEFT OUTER JOIN visit_attribute va ON va.visit_id = v.visit_id AND va.attribute_type_id =\r\n                                                                     (SELECT visit_attribute_type_id\r\n                                                                      FROM visit_attribute_type\r\n                                                                      WHERE name = \"Admission Status\")','SQL QUERY TO get LIST of patients who has pending orders','1980164b-3a92-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.patientsHasPendingOrders','select distinct\r\n          concat(pn.given_name, \" \", pn.family_name) as name,\r\n          pi.identifier as identifier,\r\n          concat(\"\",p.uuid) as uuid,\r\n          concat(\"\",v.uuid) as activeVisitUuid,\r\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\r\n        from visit v\r\n        join person_name pn on v.patient_id = pn.person_id and pn.voided = 0\r\n        join patient_identifier pi on v.patient_id = pi.patient_id\r\n        join person p on p.person_id = v.patient_id\r\n        join orders on orders.patient_id = v.patient_id\r\n        join order_type on orders.order_type_id = order_type.order_type_id and order_type.name != \"Order\" and order_type.name != \"Drug Order\"\r\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.voided = 0 and va.attribute_type_id =\r\n          (select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\")\r\n        where v.date_stopped is null AND v.voided = 0 and order_id not in\r\n          (select obs.order_id\r\n            from obs\r\n          where person_id = pn.person_id and order_id = orders.order_id)','Sql query to get list of patients who has pending orders','197696e7-3a92-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.patientsToAdmit','select distinct concat(pn.given_name,\' \', pn.family_name) as name, pi.identifier as identifier, concat(\"\",p.uuid) as uuid, concat(\"\",v.uuid) as activeVisitUuid from visit v join person_name pn on v.patient_id = pn.person_id and pn.voided = 0 AND v.voided = 0 join patient_identifier pi on v.patient_id = pi.patient_id join person p on v.patient_id = p.person_id join encounter e on v.visit_id = e.visit_id join obs o on e.encounter_id = o.encounter_id and o.voided = 0 join concept c on o.value_coded = c.concept_id join concept_name cn on c.concept_id = cn.concept_id where v.date_stopped is null and cn.name = \'Admit Patient\' and v.visit_id not in (select visit_id from encounter ie join encounter_type iet on iet.encounter_type_id = ie.encounter_type where iet.name = \'ADMISSION\')','Sql query to get list of patients to be admitted','16d39316-3a92-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emrapi.sqlSearch.patientsToDischarge','SELECT DISTINCT\r\n          concat(pn.given_name, \' \', pn.family_name) AS name,\r\n          pi.identifier AS identifier,\r\n          concat(\"\", p.uuid) AS uuid,\r\n          concat(\"\", v.uuid) AS activeVisitUuid,\r\n          IF(va.value_reference = \"Admitted\", \"true\", \"false\") as hasBeenAdmitted\r\n        FROM visit v\r\n        INNER JOIN person_name pn ON v.patient_id = pn.person_id and pn.voided is FALSE\r\n        INNER JOIN patient_identifier pi ON v.patient_id = pi.patient_id and pi.voided is FALSE\r\n        INNER JOIN person p ON v.patient_id = p.person_id\r\n        Inner Join (SELECT DISTINCT v.visit_id\r\n          FROM encounter en\r\n          INNER JOIN visit v ON v.visit_id = en.visit_id AND en.encounter_type =\r\n            (SELECT encounter_type_id\r\n              FROM encounter_type\r\n            WHERE name = \"ADMISSION\")) v1 on v1.visit_id = v.visit_id\r\n        INNER JOIN encounter e ON v.visit_id = e.visit_id\r\n        INNER JOIN obs o ON e.encounter_id = o.encounter_id\r\n        INNER JOIN concept_name cn ON o.value_coded = cn.concept_id AND cn.concept_name_type = \"FULLY_SPECIFIED\" AND cn.voided is FALSE\r\n        left outer join visit_attribute va on va.visit_id = v.visit_id and va.voided = 0 and va.attribute_type_id =\r\n          (select visit_attribute_type_id from visit_attribute_type where name=\"Admission Status\")\r\n        LEFT OUTER JOIN encounter e1 ON e1.visit_id = v.visit_id AND e1.encounter_type = (\r\n          SELECT encounter_type_id\r\n            FROM encounter_type\r\n          WHERE name = \"DISCHARGE\") AND e1.voided is FALSE\r\n        WHERE v.date_stopped IS NULL AND v.voided = 0 AND o.voided = 0 AND cn.name = \"Discharge Patient\" AND e1.encounter_id IS NULL','Sql query to get list of patients to discharge','19722fa9-3a92-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('emrapi.started','true','DO NOT MODIFY. true/false whether or not the emrapi module has been started.  This is used to make sure modules that were running  prior to a restart are started again','38b20eac-e6a2-4570-b383-ca27d7ce6f1c',NULL,NULL,NULL,NULL),('emrapi.suppressedDiagnosisConcepts',NULL,'UUIDs or mappings of suppressed diagnosis concepts','19fe23b4-0ad3-422b-8a52-4f5074b3f821',NULL,NULL,NULL,NULL),('emrapi.visitExpireHours','24','Number of hours after which visit can be auto closed','c2211396-4591-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('encounter.feed.publish.url','/openmrs/ws/rest/v1/bahmnicore/bahmniencounter/%s?includeAll=true','Url to be published on encounter save.','f4a5c029-3a91-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('encounterForm.obsSortOrder','number','The sort order for the obs listed on the encounter edit form.  \'number\' sorts on the associated numbering from the form schema.  \'weight\' sorts on the order displayed in the form schema.','da48ad9b-7687-4dc4-85ae-e8dc1cd3fb34',NULL,NULL,NULL,NULL),('encounterModifier.groovy.allowCaching','true','Allow Groovy Caching','e16605a1-266a-47cb-8385-d07742646640',NULL,NULL,NULL,NULL),('EncounterType.encounterTypes.locked','false','saving, retiring or deleting an Encounter Type is not permitted, if true','f34ea7c9-9a09-4694-b36b-be7e1b6e15f4','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('event.mandatory','false','true/false whether or not the event module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','ca6b0c3e-8236-4646-a134-4125baea158f',NULL,NULL,NULL,NULL),('event.started','true','DO NOT MODIFY. true/false whether or not the event module has been started.  This is used to make sure modules that were running  prior to a restart are started again','49b7c5fc-6f27-4589-9db2-69f9525535c8',NULL,NULL,NULL,NULL),('Form.forms.locked','false','Set to a value of true if you do not want any changes to be made on forms, else set to false.','73e388c0-e771-4a3d-8a58-134017e9c85d',NULL,NULL,NULL,NULL),('FormEntry.enableDashboardTab','true','true/false whether or not to show a Form Entry tab on the patient dashboard','d913b6b0-d57b-4272-9793-0c593147f130','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('FormEntry.enableOnEncounterTab','false','true/false whether or not to show a Enter Form button on the encounters tab of the patient dashboard','063b71bc-87e3-4606-896e-9b6a9ac3dba1','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('graph.color.absolute','rgb(20,20,20)','Color of the \'invalid\' section of numeric graphs on the patient dashboard.','b76c6f28-7f51-4f89-9332-b8136c73ebf1',NULL,NULL,NULL,NULL),('graph.color.critical','rgb(200,0,0)','Color of the \'critical\' section of numeric graphs on the patient dashboard.','e565fbd6-c39d-41c1-9ef0-8504734c92a2',NULL,NULL,NULL,NULL),('graph.color.normal','rgb(255,126,0)','Color of the \'normal\' section of numeric graphs on the patient dashboard.','85bcbf8a-9922-48b2-a5f9-15eef5917cc7',NULL,NULL,NULL,NULL),('gzip.enabled','false','Set to \'true\' to turn on OpenMRS\'s gzip filter, and have the webapp compress data before sending it to any client that supports it. Generally use this if you are running Tomcat standalone. If you are running Tomcat behind Apache, then you\'d want to use Apache to do gzip compression.','0d7404af-8e0e-43df-958f-9f937e7f54b1','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('hl7_archive.dir','hl7_archives','The default name or absolute path for the folder where to write the hl7_in_archives.','c4cdc42c-79d8-42cb-a397-4541f1941bb6',NULL,NULL,NULL,NULL),('hl7_processor.ignore_missing_patient_non_local','false','If true, hl7 messages for patients that are not found and are non-local will silently be dropped/ignored','27c81714-0688-4638-9ad8-37c11b651882','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL),('htmlwidgets.mandatory','false','true/false whether or not the htmlwidgets module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','7793aa45-0be6-4af8-83ac-5b412e5f5bb3',NULL,NULL,NULL,NULL),('htmlwidgets.started','true','DO NOT MODIFY. true/false whether or not the htmlwidgets module has been started.  This is used to make sure modules that were running  prior to a restart are started again','7fa15b20-7ca8-4a4a-90c3-bcaa0a14768f',NULL,NULL,NULL,NULL),('idgen-webservices.mandatory','false','true/false whether or not the idgen-webservices module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','91608a96-6349-4689-872b-2956da34dcc4',NULL,NULL,NULL,NULL),('idgen-webservices.started','true','DO NOT MODIFY. true/false whether or not the idgen-webservices module has been started.  This is used to make sure modules that were running  prior to a restart are started again','a028d67c-f4a2-4a68-81ab-a81f63e54cf1',NULL,NULL,NULL,NULL),('idgen.database_version','2.5.1','DO NOT MODIFY.  Current database version number for the idgen module.','6aceb38c-3a91-11e5-b380-0050568236ae',NULL,NULL,NULL,NULL),('idgen.mandatory','false','true/false whether or not the idgen module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','31a552af-a4f6-43bb-a321-bb48b6aca8dd',NULL,NULL,NULL,NULL),('idgen.started','true','DO NOT MODIFY. true/false whether or not the idgen module has been started.  This is used to make sure modules that were running  prior to a restart are started again','1352e726-7141-4ec9-a5f0-abf7adf98a40',NULL,NULL,NULL,NULL),('layout.address.format','<org.openmrs.layout.web.address.AddressTemplate>\r\n    <nameMappings class=\"properties\">\r\n      <property name=\"postalCode\" value=\"Location.postalCode\"/>\r\n      <property name=\"longitude\" value=\"Location.longitude\"/>\r\n      <property name=\"address2\" value=\"Location.address2\"/>\r\n      <property name=\"address1\" value=\"Location.address1\"/>\r\n      <property name=\"startDate\" value=\"PersonAddress.startDate\"/>\r\n      <property name=\"country\" value=\"Location.country\"/>\r\n      <property name=\"endDate\" value=\"personAddress.endDate\"/>\r\n      <property name=\"stateProvince\" value=\"Location.stateProvince\"/>\r\n      <property name=\"latitude\" value=\"Location.latitude\"/>\r\n      <property name=\"cityVillage\" value=\"Location.cityVillage\"/>\r\n    </nameMappings>\r\n    <sizeMappings class=\"properties\">\r\n      <property name=\"postalCode\" value=\"10\"/>\r\n      <property name=\"longitude\" value=\"10\"/>\r\n      <property name=\"address2\" value=\"40\"/>\r\n      <property name=\"address1\" value=\"40\"/>\r\n      <property name=\"startDate\" value=\"10\"/>\r\n      <property name=\"country\" value=\"10\"/>\r\n      <property name=\"endDate\" value=\"10\"/>\r\n      <property name=\"stateProvince\" value=\"10\"/>\r\n      <property name=\"latitude\" value=\"10\"/>\r\n      <property name=\"cityVillage\" value=\"10\"/>\r\n    </sizeMappings>\r\n    <lineByLineFormat>\r\n      <string>address1</string>\r\n      <string>address2</string>\r\n      <string>cityVillage stateProvince country postalCode</string>\r\n      <string>latitude longitude</string>\r\n      <string>startDate endDate</string>\r\n    </lineByLineFormat>\r\n  </org.openmrs.layout.web.address.AddressTemplate>','XML description of address formats','ea461e33-37d7-49e9-a23c-57b26a2076ed',NULL,NULL,NULL,NULL),('layout.name.format','short','Format in which to display the person names.  Valid values are short, long','28112e92-beb9-422a-ae28-9f2d8bbeae54',NULL,NULL,NULL,NULL),('locale.allowed.list','en, es, fr, it, pt','Comma delimited list of locales allowed for use on system','89d1db53-f7bd-4910-9b39-90d6aec00d6c',NULL,NULL,NULL,NULL),('location.field.style','default','Type of widget to use for location fields','8fd98efa-100b-4563-8777-ac6fe39351c5',NULL,NULL,NULL,NULL),('log.layout','%p - %C{1}.%M(%L) |%d{ISO8601}| %m%n','A log layout pattern which is used by the OpenMRS file appender.','abc7ecee-0504-4511-bdc0-dcd7e601a429',NULL,NULL,NULL,NULL),('log.level','org.openmrs.api:info','Logging levels for log4j.xml. Valid format is class:level,class:level. If class not specified, \'org.openmrs.api\' presumed. Valid levels are trace, debug, info, warn, error or fatal','745a26b5-13a8-4665-b356-fa26b183469e',NULL,NULL,NULL,NULL),('log.location',NULL,'A directory where the OpenMRS log file appender is stored. The log file name is \'openmrs.log\'.','9545d028-1b4a-4d55-9d49-739b18054125',NULL,NULL,NULL,NULL),('mail.debug','false','true/false whether to print debugging information during mailing','bde331aa-bcd4-4086-b6da-9cba90ad09b5',NULL,NULL,NULL,NULL),('mail.default_content_type','text/plain','Content type to append to the mail messages','a105d1ec-512c-4ad5-a30e-ac51276f0223',NULL,NULL,NULL,NULL),('mail.from','info@openmrs.org','Email address to use as the default from address','00be01d9-42b6-4991-b9f5-e57ce22d4c83',NULL,NULL,NULL,NULL),('mail.password','test','Password for the SMTP user (if smtp_auth is enabled)','c4966076-eb7d-43fc-a126-fce90423cfc2',NULL,NULL,NULL,NULL),('mail.smtp.starttls.enable','false','Set to true to enable TLS encryption, else set to false','eeb98980-5998-4c36-a348-a6e2004a4af0',NULL,NULL,NULL,NULL),('mail.smtp_auth','false','true/false whether t